css:
@-moz-document domain("metanit.com") {
body {
    background: #3b3b3b;
    color: white;
}
.menC {
    background: #2a2a2a;
}
.syntaxhighlighter .comments,
.syntaxhighlighter .comments a {
    color: #0db30d !important;
}
.syntaxhighlighter .line.alt2 {
    background-color: #151515 !important;
}
.syntaxhighlighter .line.alt1 {
    background-color: #1d1d1d!important;
}
.syntaxhighlighter .plain,
.syntaxhighlighter .plain a {
    color: #e1e1e1 !important;
}
.syntaxhighlighter .keyword {
    color: #00aaff !important;
}
.syntaxhighlighter .string,
.syntaxhighlighter .string a {
    color: #ef5305 !important;
}
.syntaxhighlighter .gutter {
    color: #cacaca !important;
}
h1,
h2,
h3,
h4 {
    color: #c3c8e1;
}
.menC .share .fa,
.menC .like .fa {
    background-color: #191919;
}
.menC .socialtop .fa,
.menC .socialbottom .fa {
    border-color: #404248;
}
#container {
    background-color: #2a2a2a;
}
#menu {
    background: #2a2a2a;
}
#menu .mainmenu li > a {
    border-left: 0px;
    background: -webkit-gradient(linear, left top, left bottom, from(#464646), to(#272727));
}
#menu > ul > li > a {
    color: #dadef3;
}
.date {
    color: #c2c2c2;
}
#logo {
    color: #b4bbdf;
}
#logo a {
    color: #a4adf5;
}
#logo a,
#logo a:visited {
    color: #aaacba;
}
element.style {
    color: #747373;
}
.socialbtns .fa {
    color: #777 !important;
}
.dn {
    color: #888b99;
}
.filetree span.file a {
    color: #a4a4a5;
}
.filetree span.folder {
    color: #a4a4a5;
}
.menT a {
    color: #a4a4a5;
}
.syntaxhighlighter .gutter .line {
    border-right: 3px solid #1b2557 !important;
}
.menC a {
    color: #babaff !important;
}
.bootomLinks a {
    color: #c5c7cc;
}
.filetree li:hover > .folder {
    color: #ffffff;
    background-color: #6f6b6b;
}
.filetree li ul li:hover > .file a {
    background-color: #424242;
    color: #f5f5f5;
}
.filetree li ul li:hover > .file {
    color: #f5f5f5;
    background-color: #424242;
}
}
